# coding=utf-8
from openaid.crs.code_lists.donors import CodeName

__author__ = 'joke2k'

CHANNELS = []

class Channel(CodeName):

    ALL = CHANNELS

    def __init__(self, code, name, parent, acrnoym=None, contrib_coefficient=None, dac=None, mcd=None, notes=None, *args, **kwargs):
        super(Channel, self).__init__(code, name, *args, **kwargs)
        self.acronym = acrnoym
        self.contrib_coefficient = contrib_coefficient
        self.dac = dac
        self.mcd = mcd
        self.notes = notes or ''
        if parent == code:
            # not leaf node
            real_parent_code = code / 10000 * 10000
            if real_parent_code == parent:
                # root node
                self.parent = None
            else:
                # intermediate node
                self.parent = Channel.get_by_code(real_parent_code)
        else:
            self.parent = Channel.get_by_code(parent)


